    "2016-06-01T01:07:27.528796",nt"name": "summer-food-service-program-sfsp-area-eligibility-mapper",nt"isopen":
    true,nt"url": null,nt"notes": "Allows users to confirm eligibility of summer
    meal sites by accessing census tract and census block group (CBG) data. This tool
    can also be used to conduct weighted averaging as discussed in SFSP Policy Memorandum
    10-2015, u201cArea Eligibility in Child Nutrition Programs,u201d published Nov.
    21, 2014, available at http://www.fns.usda.gov/area-eligibility-child-nutrition-programs-0.
    Instructions for determining eligibility using these data are available at: http://www.fns.usda.gov/sites/default/files/Census%20Instructions%202014_0.pdf.
    The instructions offer two different tools to determine eligibility: the FNS Area
    Eligibility Mapper and a map developed by the Food Research and Action Center (FRAC).
    The FRAC map is constructed from the same data files and also may be used to determine
    eligibility. Additionally, State agencies may request the data file for every CBG
    and census tract, including Federal Information Processing Standards (FIPS) codes
    for Geographic Information System (GIS) efforts, in their State. State agencies
    also may provide these data to institutions and partners upon request. This tool
    can also be used to identify locations that are area eligible for participation
    in other Child Nutrition Programs.",nt"license_title": "Creative Commons CCZero",nt"extras":
